      AlphaStaticIslandMap.LocDescription = Loc.Str("AlphaStaticIslandMap__desc", "A balanced map, great for new or casual players. The starting location offers easy access to all resources and plenty of space to build a large factory. Later on, create ramps to the higher platforms to scale up industrial and mining operations.\r\n\r\nThis is the first and oldest map in Captain of Industry. It was first available in a closed-alpha build in October of 2021. Back then, it was the only playable map in the game.", "Map description");
